<!DOCTYPE html>
<html lang="es-NI">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Diagrama</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <style>
        .drm{
            width: 100%;
            height: 100vh;
            object-fit: contain;
        }
        .pointer-events-none {
        pointer-events: none;
    }
    </style>
</head>

<body>
    <!-- Navbar superior para pantallas grandes -->
    <header class="fixed top-0 inset-x-0 text-white bg-[#040C1C]/40 backdrop-blur-lg z-[1000] body-font hidden md:block">
        <div class="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center">
            <a class="flex title-font font-medium items-center h-10 w-44 text-gray-900 mb-4 md:mb-0">
                <img src="https://www.nicaraguainnova.gob.ni/wp-content/uploads/2024/10/LOGO-CNU-07.png" alt="">
            </a>
            <nav
                class="md:mr-auto md:ml-4 md:py-1 md:pl-4 md:border-l md:border-gray-400 flex flex-wrap items-center text-base justify-center">
                <a class="mr-5 hover:text-gray-900">Inicio</a>
                <a class="mr-5 hover:text-gray-900">Diagrama</a>
            </nav>
            <button
                class="inline-flex items-center bg-gray-100 border-0 py-1 px-3 focus:outline-none hover:bg-gray-200 rounded text-base mt-4 md:mt-0">
                Button
                <svg fill="none" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2"
                    class="w-4 h-4 ml-1" viewBox="0 0 24 24">
                    <path d="M5 12h14M12 5l7 7-7 7"></path>
                </svg>
            </button>
        </div>
    </header>


    <section class="bg-gradient-to-br from-indigo-900 to-green-900 min-h-screen overflow-auto pt-20" oncontextmenu="return false;">
        <div class="container max-w-5xl mx-auto px-4">
            <div class="w-4/5">
                <h1 class="mt-32 text-white text-6xl font-bold uppercase">Diagrama de la base de MAtrícula<br /><span
                        class="text-blue-400">CNU</span></h1>
            </div>
            
            <div class="hidden sm:block opacity-50 z-0">
                <div class="shadow-2xl w-96 h-96 rounded-full -mt-72"></div>
                <div class="shadow-2xl w-96 h-96 rounded-full -mt-96"></div>
                <div class="shadow-xl w-80 h-80 rounded-full ml-8 -mt-96"></div>
            </div>

        </div>
        <!-- Contenedor Principal -->
        <div class="max-w-full m-4 h-screen bg-white overflow-hidden relative border border-gray-300">
            <div class="absolute top-4 left-4 z-10 flex space-x-2">
                <button id="zoom-in" class="px-4 py-2 bg-blue-500 text-white rounded shadow hover:bg-blue-600">
                    Ampliar
                </button>
                <button id="zoom-out" class="px-4 py-2 bg-red-500 text-white rounded shadow hover:bg-red-600">
                    Alejar
                </button>
            </div>
            <!-- Controles de Zoom -->
        
            <!-- Contenedor de Canvas -->
            <div id="image-container" class="w-full h-full relative cursor-grab">
                <canvas id="canvas" class="w-full h-full"></canvas>
            </div>
        </div>


    </section>
    
    <!-- Navbar inferior para pantallas pequeñas -->
    <div
        class="fixed inset-x-0 bottom-0 bg-gray-900 text-white flex justify-around items-center h-16 shadow-lg z-[1000] lg:hidden">
        <!-- Link 1 -->
        <a href="#home" class="flex flex-col items-center text-xs hover:text-blue-500 h-4 w-20 space-y-1">
            <!-- <a class="flex title-font font-medium items-center h-10 w-44 text-gray-900 mb-4 md:mb-0"> -->
                <img src="https://www.nicaraguainnova.gob.ni/wp-content/uploads/2024/10/LOGO-CNU-07.png" alt="">
            <!-- </a> -->
        </a>
        <a href="#home" class="flex flex-col items-center text-xs hover:text-blue-500 space-y-1">
            <i class="fas fa-home text-xl"></i>
            <span>Inicio</span>
        </a>

        <!-- Link 2 -->
        <a href="#search" class="flex flex-col items-center text-xs hover:text-blue-500 space-y-1">
            <i class="fa-solid fa-robot text-xl"></i>
            <span>Diagrama</span>
        </a>
    </div>

    <div id="overlay" class="hidden fixed inset-0 bg-black z-[9999]"></div>
</body>

       let scale = 1;
    const scaleFactor = 1.1;
    let offsetX = 0, offsetY = 0; // Control de desplazamiento
    let isDragging = false;
    let startX, startY;

    image.onload = function () {
        // Ajusta el tamaño inicial del canvas para igualar el tamaño del contenedor
        canvas.width = canvas.parentElement.offsetWidth;
        canvas.height = canvas.parentElement.offsetHeight;
        draw();
    };

    function draw() {
        // Limpia el canvas
        ctx.clearRect(0, 0, canvas.width, canvas.height);

        // Calcula las dimensiones de la imagen escalada
        const scaledWidth = image.width * scale;
        const scaledHeight = image.height * scale;

        // Dibuja la imagen escalada con desplazamiento
        ctx.drawImage(
            image,
            offsetX, offsetY,
            scaledWidth, scaledHeight
        );
    }

    // Zoom in
    document.getElementById('zoom-in').addEventListener('click', () => {
        const previousScale = scale;
        scale *= scaleFactor;

        // Ajusta el desplazamiento para centrar el zoom en el área actual
        offsetX -= (canvas.width / 2 - offsetX) * (scaleFactor - 1);
        offsetY -= (canvas.height / 2 - offsetY) * (scaleFactor - 1);

        draw();
    });

    // Zoom out
    document.getElementById('zoom-out').addEventListener('click', () => {
        const previousScale = scale;
        scale /= scaleFactor;

        // Ajusta el desplazamiento para centrar el zoom en el área actual
        offsetX += (canvas.width / 2 - offsetX) * (1 - 1 / scaleFactor);
        offsetY += (canvas.height / 2 - offsetY) * (1 - 1 / scaleFactor);

        draw();
    });

    // Mover canvas con arrastrar
    const imageContainer = document.getElementById('image-container');
    imageContainer.addEventListener('mousedown', (e) => {
        isDragging = true;
        startX = e.clientX - offsetX;
        startY = e.clientY - offsetY;
        imageContainer.style.cursor = 'grabbing';
    });

    imageContainer.addEventListener('mousemove', (e) => {
        if (isDragging) {
            offsetX = e.clientX - startX;
            offsetY = e.clientY - startY;
            draw();
        }
    });

    imageContainer.addEventListener('mouseup', () => {
        isDragging = false;
        imageContainer.style.cursor = 'grab';
    });

    imageContainer.addEventListener('mouseleave', () => {
        isDragging = false;
        imageContainer.style.cursor = 'grab';
    });
</script>

<script>
    const overlay = document.getElementById('overlay');

    function detectScreenshot() {
        // Muestra una superposición negra al intentar tomar una captura
        overlay.classList.remove('hidden');

        // Esconde la superposición después de un breve período (por si fue un error)
        setTimeout(() => {
            overlay.classList.add('hidden');
        }, 1000);
    }

    // Escucha eventos sospechosos de captura de pantalla
    document.addEventListener('visibilitychange', () => {
        if (document.visibilityState === 'hidden') {
            detectScreenshot();
        }
    });

    window.addEventListener('resize', () => {
        // Activa la superposición si el tamaño de la ventana cambia sospechosamente
        detectScreenshot();
    });
</script>

</html>
